// HomePage.js
import React from "react";
import { Link } from "react-router-dom";
import "./"


const HomePage = () => {
  return (
    <div>
      <div class="header">
        <h2>Welcome to the Home Page</h2>
      </div>
      <ul>
        <li>
          <Link to="/">HomePage</Link>
        </li>
        <li>
          <Link to="/contact">Contact</Link>
        </li>
      </ul>
    </div>
  );
};

export default HomePage;
